import React, { useEffect } from 'react';
import { ChevronLeft, Star, Calendar, User, Home, Download, Share2 } from 'lucide-react';
import './App.css';
import { useNavigate } from 'react-router-dom';

const Result = ({ formData, onReset }) => {
  const navigate = useNavigate();
  const today = new Date();
  const currentYear = today.getFullYear();
  const currentMonth = today.getMonth() + 1;
  const currentDay = today.getDate();

  // Check if formData exists, if not redirect to home
  useEffect(() => {
    if (!formData || !formData.name || !formData.day || !formData.month || !formData.year) {
      navigate('/');
    }
  }, [formData, navigate]);

  const reduceToSingleDigit = (num) => {
    while (num > 9 && num !== 11 && num !== 22 && num !== 33) {
      num = num.toString().split('').reduce((sum, digit) => sum + parseInt(digit), 0);
    }
    return num;
  };

  const calculateBirthNumber = (day) => reduceToSingleDigit(parseInt(day));
  const calculateLifePathNumber = (day, month, year) =>
    reduceToSingleDigit(parseInt(day) + parseInt(month) + parseInt(year));
  const calculatePersonalYear = (day, month, year) =>
    reduceToSingleDigit(parseInt(day) + parseInt(month) + year);
  const calculatePersonalMonth = (year, month) => reduceToSingleDigit(year + month);
  const calculatePersonalDay = (month, day) => reduceToSingleDigit(month + day);

  const getZodiacSign = (day, month) => {
    const signs = [
      'Capricorn', 'Aquarius', 'Pisces', 'Aries', 'Taurus', 'Gemini',
      'Cancer', 'Leo', 'Virgo', 'Libra', 'Scorpio', 'Sagittarius'
    ];
    const cutoff = [20, 19, 20, 20, 21, 21, 23, 23, 23, 23, 22, 22];
    return day <= cutoff[month - 1]
      ? signs[(month + 10) % 12]
      : signs[month - 1];
  };

  const getBirthNumberDescription = (num) => {
    const descriptions = {
      1: 'The Leader - Natural born leader with strong willpower, independence, and pioneering spirit. You are ambitious, original, and have the drive to initiate new projects.',
      2: 'The Diplomat - Cooperative, sensitive, and peaceful. You excel in partnerships, have strong intuition, and are naturally diplomatic in handling relationships.',
      3: 'The Creative - Artistic, expressive, and optimistic. You have natural talent for communication, creativity, and bringing joy to others through your artistic abilities.',
      4: 'The Builder - Practical, disciplined, and hardworking. You are methodical, reliable, and have the ability to build solid foundations for long-term success.',
      5: 'The Adventurer - Freedom-loving, curious, and dynamic. You crave variety, travel, and new experiences. Change and versatility are your natural elements.',
      6: 'The Nurturer - Caring, responsible, and family-oriented. Natural healers and caretakers who serve others with love, compassion, and a strong sense of duty.',
      7: 'The Seeker - Spiritual, analytical, and introspective. You are naturally drawn to mysteries, research, and seeking deeper truths about life and existence.',
      8: 'The Achiever - Ambitious with strong business acumen and material focus. You have natural leadership abilities and the power to achieve significant material success.',
      9: 'The Humanitarian - Compassionate, generous, and wise. You have a global perspective and are naturally drawn to serving humanity and making the world better.',
      11: 'The Intuitive - Master number with powerful intuition and psychic abilities. Highly spiritual, inspirational, and visionary with strong connection to higher realms.',
      22: 'The Master Builder - Master number combining practical skills with visionary ideas. You have the ability to turn dreams into reality on a large scale.',
      33: 'The Master Teacher - Master number representing compassionate service. You are here to uplift humanity through teaching, healing, and unconditional love.'
    };
    return descriptions[num] || 'A unique soul with special gifts waiting to be discovered.';
  };

  const getLifePathDescription = (num) => {
    const descriptions = {
      1: 'The Pioneer - Your life path is about leadership, independence, and breaking new ground. You are here to learn self-reliance and to lead others toward innovation.',
      2: 'The Cooperator - Your life path focuses on relationships, cooperation, and bringing harmony. You are here to learn the power of partnership and peaceful collaboration.',
      3: 'The Communicator - Your life path centers on creative expression and communication. You are here to inspire others through your creativity, optimism, and artistic talents.',
      4: 'The Organizer - Your life path is about building, organizing, and creating stability. You are here to establish solid foundations and bring order to chaos.',
      5: 'The Freedom Seeker - Your life path involves adventure, freedom, and experiencing life fully. You are here to learn through variety, travel, and embracing change.',
      6: 'The Healer - Your life path focuses on service, healing, and nurturing others. You are here to learn responsibility and to care for family and community.',
      7: 'The Mystic - Your life path is about seeking truth, spiritual growth, and inner wisdom. You are here to develop intuition and understand life\'s deeper mysteries.',
      8: 'The Executive - Your life path centers on material achievement and business success. You are here to learn about power, authority, and material manifestation.',
      9: 'The Humanitarian - Your life path is about serving humanity and sharing universal love. You are here to learn compassion and to help heal the world.',
      11: 'The Inspirational Teacher - Master number path focused on spiritual inspiration and enlightenment. You are here to be a beacon of light for others.',
      22: 'The Master Manifester - Master number path combining spiritual vision with practical application. You are here to build something lasting for humanity.',
      33: 'The Master Healer - Master number path of compassionate service and healing. You are here to teach unconditional love and spiritual healing.'
    };
    return descriptions[num] || 'A unique life journey filled with special lessons and opportunities for growth.';
  };

  const getPersonalYearDescription = (num) => {
    const descriptions = {
      1: 'New Beginnings - This is your year of fresh starts, new opportunities, and taking initiative. Focus on independence and starting new projects.',
      2: 'Cooperation & Patience - This year emphasizes partnerships, diplomacy, and patience. Focus on relationships and collaborative efforts.',
      3: 'Creative Expression - This year highlights creativity, communication, and social activities. Express yourself through art, writing, or speaking.',
      4: 'Hard Work & Foundation - This year requires discipline, hard work, and building solid foundations. Focus on practical matters and long-term planning.',
      5: 'Change & Adventure - This year brings freedom, travel, and new experiences. Embrace change and explore new opportunities.',
      6: 'Responsibility & Service - This year focuses on family, home, and service to others. Take care of responsibilities and nurture relationships.',
      7: 'Spiritual Growth - This year emphasizes inner development, study, and spiritual growth. Focus on self-reflection and seeking wisdom.',
      8: 'Material Achievement - This year highlights business success, material gains, and recognition. Focus on career advancement and financial goals.',
      9: 'Completion & Letting Go - This year is about endings, completion, and humanitarian service. Release what no longer serves and help others.'
    };
    return descriptions[num] || 'A year of unique opportunities and personal growth.';
  };

  // Handle case where formData might be null/undefined
  if (!formData) {
    return null;
  }

  // Final Calculations
  const birthNumber = calculateBirthNumber(formData.day);
  const lifePathNumber = calculateLifePathNumber(formData.day, formData.month, formData.year);
  const personalYear = calculatePersonalYear(formData.day, formData.month, currentYear);
  const personalMonth = calculatePersonalMonth(personalYear, currentMonth);
  const personalDay = calculatePersonalDay(personalMonth, currentDay);
  const zodiac = getZodiacSign(parseInt(formData.day), parseInt(formData.month));

  const handleBack = () => {
    if (onReset) {
      onReset();
    } else {
      navigate('/');
    }
  };

  const handleShare = () => {
    if (navigator.share) {
      navigator.share({
        title: `${formData.name}'s Numerology Report`,
        text: `Check out my numerology report! Life Path: ${lifePathNumber}, Birth Number: ${birthNumber}`,
        url: window.location.href
      });
    } else {
      // Fallback to copying to clipboard
      const shareText = `${formData.name}'s Numerology Report:\nLife Path: ${lifePathNumber}\nBirth Number: ${birthNumber}\nPersonal Year: ${personalYear}`;
      navigator.clipboard.writeText(shareText).then(() => {
        alert('Report details copied to clipboard!');
      });
    }
  };

  const handleDownload = () => {
    const reportContent = `
NUMEROLOGY REPORT FOR ${formData.name.toUpperCase()}
Generated on: ${new Date().toLocaleDateString()}

CORE NUMBERS:
• Birth Number: ${birthNumber}
• Life Path Number: ${lifePathNumber}
• Personal Year: ${personalYear}

CURRENT CYCLE:
• Personal Month: ${personalMonth}
• Personal Day: ${personalDay}
• Zodiac Sign: ${zodiac}

BIRTH NUMBER INSIGHTS:
${getBirthNumberDescription(birthNumber)}

LIFE PATH INSIGHTS:
${getLifePathDescription(lifePathNumber)}

PERSONAL YEAR GUIDANCE:
${getPersonalYearDescription(personalYear)}

---
Generated by NumPath - Mystic Numerology Portal
    `.trim();

    const blob = new Blob([reportContent], { type: 'text/plain' });
    const url = URL.createObjectURL(blob);
    const a = document.createElement('a');
    a.href = url;
    a.download = `${formData.name}_Numerology_Report.txt`;
    document.body.appendChild(a);
    a.click();
    document.body.removeChild(a);
    URL.revokeObjectURL(url);
  };

  return (
    <div className="result-container" style={{
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '2rem 1rem'
    }}>
      <div className="result-content" style={{ maxWidth: '1200px', margin: 'auto' }}>

        {/* Header with Actions */}
        <div style={{ 
          display: 'flex', 
          justifyContent: 'space-between', 
          alignItems: 'center', 
          marginBottom: '2rem',
          flexWrap: 'wrap',
          gap: '1rem'
        }}>
          <button 
            onClick={handleBack} 
            className="back-button"
            style={{
              display: 'flex',
              alignItems: 'center',
              gap: '0.5rem',
              background: 'rgba(255, 255, 255, 0.1)',
              border: '1px solid rgba(255, 255, 255, 0.2)',
              color: 'white',
              padding: '12px 20px',
              borderRadius: '25px',
              cursor: 'pointer',
              transition: 'all 0.3s ease',
              fontWeight: '500'
            }}
          >
            <ChevronLeft size={18} /> Back to Calculator
          </button>

          <div style={{ display: 'flex', gap: '1rem' }}>
            <button
              onClick={handleShare}
              style={{
                display: 'flex',
                alignItems: 'center',
                gap: '0.5rem',
                background: 'rgba(74, 222, 128, 0.2)',
                border: '1px solid rgba(74, 222, 128, 0.3)',
                color: 'white',
                padding: '10px 16px',
                borderRadius: '20px',
                cursor: 'pointer',
                fontSize: '14px'
              }}
            >
              <Share2 size={16} /> Share
            </button>
            <button
              onClick={handleDownload}
              style={{
                display: 'flex',
                alignItems: 'center',
                gap: '0.5rem',
                background: 'rgba(59, 130, 246, 0.2)',
                border: '1px solid rgba(59, 130, 246, 0.3)',
                color: 'white',
                padding: '10px 16px',
                borderRadius: '20px',
                cursor: 'pointer',
                fontSize: '14px'
              }}
            >
              <Download size={16} /> Download
            </button>
          </div>
        </div>

        {/* Report Header */}
        <div className="result-header" style={{
          textAlign: 'center',
          marginBottom: '3rem',
          background: 'rgba(255, 255, 255, 0.1)',
          backdropFilter: 'blur(10px)',
          border: '1px solid rgba(255, 255, 255, 0.2)',
          borderRadius: '20px',
          padding: '2rem'
        }}>
          <h1 className="result-title" style={{
            fontSize: '3rem',
            fontWeight: 'bold',
            background: 'linear-gradient(45deg, #ff6b6b, #4ecdc4, #45b7d1)',
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            marginBottom: '0.5rem'
          }}>
            🔮 Numerology Report
          </h1>
          <p className="result-subtitle" style={{
            fontSize: '1.5rem',
            color: 'rgba(255, 255, 255, 0.9)',
            fontWeight: '300'
          }}>
            for {formData.name}
          </p>
          <p style={{
            color: 'rgba(255, 255, 255, 0.7)',
            marginTop: '1rem',
            fontSize: '0.9rem'
          }}>
            Birth Date: {formData.day}/{formData.month}/{formData.year} • Generated: {new Date().toLocaleDateString()}
          </p>
        </div>

        {/* Results Grid */}
        <div className="results-grid" style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(auto-fit, minmax(350px, 1fr))',
          gap: '2rem',
          marginBottom: '3rem'
        }}>

          {/* Core Numbers Card */}
          <div className="result-card core-numbers-card" style={{
            background: 'rgba(255, 255, 255, 0.1)',
            backdropFilter: 'blur(10px)',
            border: '1px solid rgba(255, 255, 255, 0.2)',
            borderRadius: '20px',
            padding: '2rem',
            transition: 'transform 0.3s ease'
          }}>
            <div className="card-header" style={{
              display: 'flex',
              alignItems: 'center',
              gap: '1rem',
              marginBottom: '1.5rem'
            }}>
              <div className="icon-container" style={{
                background: 'linear-gradient(45deg, #ff6b6b, #ee5a24)',
                padding: '12px',
                borderRadius: '12px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}>
                <Star color="white" size={24} />
              </div>
              <div className="card-title" style={{
                fontSize: '1.5rem',
                fontWeight: 'bold',
                color: 'white'
              }}>
                Core Numbers
              </div>
            </div>

            <div className="number-row" style={{
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              marginBottom: '1rem',
              padding: '1rem',
              background: 'rgba(255, 255, 255, 0.05)',
              borderRadius: '10px'
            }}>
              <span className="number-label" style={{ color: 'rgba(255, 255, 255, 0.9)', fontSize: '1.1rem' }}>
                Birth Number:
              </span>
              <span className="number-value primary" style={{
                fontSize: '2rem',
                fontWeight: 'bold',
                background: 'linear-gradient(45deg, #ff6b6b, #4ecdc4)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent'
              }}>
                {birthNumber}
              </span>
            </div>

            <div className="number-row" style={{
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              marginBottom: '1rem',
              padding: '1rem',
              background: 'rgba(255, 255, 255, 0.05)',
              borderRadius: '10px'
            }}>
              <span className="number-label" style={{ color: 'rgba(255, 255, 255, 0.9)', fontSize: '1.1rem' }}>
                Life Path Number:
              </span>
              <span className="number-value primary master-number" style={{
                fontSize: '2rem',
                fontWeight: 'bold',
                background: 'linear-gradient(45deg, #4ecdc4, #45b7d1)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent'
              }}>
                {lifePathNumber}
              </span>
            </div>

            <div className="number-row" style={{
              display: 'flex',
              justifyContent: 'space-between',
              alignItems: 'center',
              padding: '1rem',
              background: 'rgba(255, 255, 255, 0.05)',
              borderRadius: '10px'
            }}>
              <span className="number-label" style={{ color: 'rgba(255, 255, 255, 0.9)', fontSize: '1.1rem' }}>
                Personal Year:
              </span>
              <span className="number-value primary" style={{
                fontSize: '2rem',
                fontWeight: 'bold',
                background: 'linear-gradient(45deg, #45b7d1, #96ceb4)',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent'
              }}>
                {personalYear}
              </span>
            </div>
          </div>

          {/* Current Cycle Card */}
          <div className="result-card current-cycle-card" style={{
            background: 'rgba(255, 255, 255, 0.1)',
            backdropFilter: 'blur(10px)',
            border: '1px solid rgba(255, 255, 255, 0.2)',
            borderRadius: '20px',
            padding: '2rem'
          }}>
            <div className="card-header" style={{
              display: 'flex',
              alignItems: 'center',
              gap: '1rem',
              marginBottom: '1.5rem'
            }}>
              <div className="icon-container" style={{
                background: 'linear-gradient(45deg, #4ecdc4, #45b7d1)',
                padding: '12px',
                borderRadius: '12px',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center'
              }}>
                <Calendar color="white" size={24} />
              </div>
              <div className="card-title" style={{
